Information
------------------------------

BBC America: The Science of Doctor Who
Like all great science fiction shows, there are kernels of truth and nuggets of science fact scattered throughout the incredible &quot;Doctor Who&quot; universe. In this special, we are going to explore these dynamic &quot;Doctor Who&quot; moments where science fiction and science fact converge and mingle. With Michio Kaku, Jim Al Khalili and Maggie Aderin Pocock

